import React from 'react';
import Navbar from './Navbar';
import Navbar2 from './Navbar2';
import Footer from './Footer';
import ContactL from './ContactL';

const Contact=()=>{
    return(
        <>
       <Navbar/>
        <Navbar2/>
        <ContactL/>
        <Footer/>
        </>
    );
};
export default Contact;
